import React from "react";
import './style.css';

import By from './by.png';
import discord from './icons/discord_icon.png';
import reddit from './icons/reddit_icon.png';
import medium from './icons/medium_icon.png';
import linked from './icons/linked_icon.png';
import github from './icons/github_icon.png';
import twitter from './icons/twitter_icon.png';

export default function Footer(){
    return (
        <>
            <hr />
            <div className="footer-body">
                <div className="by-logo">
                    <img src={By} alt="" srcset="" />
                    <h1 className="by-text">Gybernaty</h1>
                </div>
                <div className="icons">
                    <img src={reddit} alt="" srcset="" />
                    <img src={medium} alt="" srcset="" />
                    <img src={linked} alt="" srcset="" />
                    <img src={github} alt="" srcset="" />
                    <img src={twitter} alt="" srcset="" />
                    <img src={discord} alt="" srcset="" />
                </div>
            </div>
            <hr />
        </>
    );
}
